import React from "react";
class SearchBar extends React.Component {
    render() {
        return (
            <div >
                <form>
                    <input type="text"
                        style={{ fontSize: "15px", height: "45px", width: "500px", border: "0px", padding: "10px", boxSizing: "border-box" }}
                        onChange={this.props.onChange}
                    />
                    <button
                        style={{ width: "100px", height: "45px", fontSize: "15px", backgroundColor: "#2d2d2d", border: "0px", color: "white" }}>SEARCH</button>
                </form>
            </div>

        );
    }
}

export default SearchBar;
